import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';
import './Gallery.css';

class Gallery extends Component {
  render() {
    return (
        <Container className="gallery-container">
          <Row className="mb-5">
            <Col md={{ size: 6, offset: 3 }}>
              <SearchBox />  
            </Col>
          </Row>
        </Container>
    );
  }
}

export default Gallery;
